import React, { useState, useEffect } from 'react';
import axios from 'axios';
import LiveGamesBar from '../components/LiveGamesBar';
import StandingsTable from '../components/StandingsTable';
import NewsSection from '../components/NewsSection';
import PredictionsWidget from '../components/PredictionsWidget';

const API_BASE_URL = 'http://localhost:8000/api';

const Dashboard = () => {
  const [liveGames, setLiveGames] = useState([]);
  const [standings, setStandings] = useState([]);
  const [news, setNews] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetchDashboardData();
  }, []);

  const fetchDashboardData = async () => {
    try {
      setLoading(true);

      const [gamesRes, standingsRes, newsRes] = await Promise.all([
        axios.get(`${API_BASE_URL}/live-games`),
        axios.get(`${API_BASE_URL}/standings`),
        axios.get(`${API_BASE_URL}/news`)
      ]);

      setLiveGames(gamesRes.data.games || []);
      setStandings(standingsRes.data.standings || []);
      setNews(newsRes.data.articles || []);

    } catch (error) {
      console.error('Error fetching dashboard data:', error);
    } finally {
      setLoading(false);
    }
  };

  if (loading) {
    return (
      <div className="flex justify-center items-center min-h-screen">
        <div className="animate-spin rounded-full h-32 w-32 border-b-2 border-nba-blue"></div>
      </div>
    );
  }

  return (
    <div className="space-y-8 fade-in-up">
      {/* Page Header */}
      <div className="text-center">
        <h1 className="text-4xl font-bold text-gray-900 mb-4">
          NBA <span className="gradient-text">Analytics Dashboard</span>
        </h1>
        <p className="text-xl text-gray-600">
          Real-time data, advanced analytics, and ML-powered predictions
        </p>
      </div>

      {/* Live Games Bar */}
      <LiveGamesBar games={liveGames} />

      {/* Vertical Teams Bar */}
      <VerticalTeamsBar teams={teams} />

      {/* Main Dashboard Grid */}
      <div className="grid grid-cols-1 lg:grid-cols-3 gap-8">
        {/* Main Content Area */}
        <div className="lg:col-span-2 space-y-8">
          {/* Standings Table */}
          <StandingsTable standings={standings} />

          {/* News Section */}
          <NewsSection articles={news} />
        </div>

        {/* Right Sidebar - Predictions & Highlights */}
        <div className="lg:col-span-1 space-y-6">
          <PredictionsWidget />

          {/* Quick Stats Card */}
          <div className="card p-6">
            <h3 className="text-lg font-semibold text-gray-900 mb-4">
              Today's Highlights
            </h3>
            <div className="space-y-4">
              <div className="flex justify-between items-center p-3 bg-blue-50 rounded-lg">
                <span className="text-sm font-medium">Games Today</span>
                <span className="text-xl font-bold text-nba-blue">{liveGames.length}</span>
              </div>
              <div className="flex justify-between items-center p-3 bg-green-50 rounded-lg">
                <span className="text-sm font-medium">Active Teams</span>
                <span className="text-xl font-bold text-green-600">30</span>
              </div>
              <div className="flex justify-between items-center p-3 bg-purple-50 rounded-lg">
                <span className="text-sm font-medium">ML Models</span>
                <span className="text-xl font-bold text-purple-600">5</span>
              </div>
            </div>
          </div>
        </div>
      </div>

      {/* Analytics Preview Section */}
      <div className="grid grid-cols-1 md:grid-cols-3 gap-6 mt-12">
        <div className="card p-6 text-center">
          <div className="w-12 h-12 bg-blue-100 rounded-lg flex items-center justify-center mx-auto mb-4">
            <svg className="w-6 h-6 text-nba-blue" fill="none" stroke="currentColor" viewBox="0 0 24 24">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M9 19v-6a2 2 0 00-2-2H5a2 2 0 00-2 2v6a2 2 0 002 2h2a2 2 0 002-2zm0 0V9a2 2 0 012-2h2a2 2 0 012 2v10m-6 0a2 2 0 002 2h2a2 2 0 002-2m0 0V5a2 2 0 012-2h2a2 2 0 012 2v14a2 2 0 01-2 2h-2a2 2 0 01-2-2z" />
            </svg>
          </div>
          <h3 className="text-lg font-semibold text-gray-900 mb-2">Real-Time Analytics</h3>
          <p className="text-gray-600">Live game data and performance metrics updated in real-time</p>
        </div>

        <div className="card p-6 text-center">
          <div className="w-12 h-12 bg-red-100 rounded-lg flex items-center justify-center mx-auto mb-4">
            <svg className="w-6 h-6 text-nba-red" fill="none" stroke="currentColor" viewBox="0 0 24 24">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M13 10V3L4 14h7v7l9-11h-7z" />
            </svg>
          </div>
          <h3 className="text-lg font-semibold text-gray-900 mb-2">ML Predictions</h3>
          <p className="text-gray-600">Advanced machine learning models for player and game predictions</p>
        </div>

        <div className="card p-6 text-center">
          <div className="w-12 h-12 bg-green-100 rounded-lg flex items-center justify-center mx-auto mb-4">
            <svg className="w-6 h-6 text-green-600" fill="none" stroke="currentColor" viewBox="0 0 24 24">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M7 12l3-3 3 3 4-4M8 21l4-4 4 4M3 4h18M4 4h16v12a1 1 0 01-1 1H5a1 1 0 01-1-1V4z" />
            </svg>
          </div>
          <h3 className="text-lg font-semibold text-gray-900 mb-2">Interactive Charts</h3>
          <p className="text-gray-600">Beautiful visualizations and interactive data exploration</p>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
